import API from "../utils/api";
import React, {useState,useEffect } from "react";
let test1=[];
let test2;
const HomePage= ()=>{
    const [myState,setState]=useState({
        firstName:"",
        lastName:"",
        gender:"",
        nat:""
    })
    useEffect(()=>{
    API.seed()
    .then(res=>{
        const user=res.data; 
        JSON.parse(user)   
        user.results.map(user=>{
            setState({
                firstName:user.name.first,
                lastName:user.name.last,
                gender:user.gender,
                nat:user.nat,
            })
        })   
        // .forEach(element=>test1.push((element.name.first))),
